      SELECT ALL + - ( - - 76 ) AS col2, 51 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 IS NULL;
  - name: tab2

outputs:
  - name: q5245.out
    data: |
      -76	51
      -76	51
      -76	51
